<!doctype html>
                <meta charset="UTF-8">
                <title>Webpack Visualizer</title>
                <style>html {
    background-color: #f7eedf;
    color: #333;
}

body {
    font-family: sans-serif;
    margin: 10px auto 0;
    width: 750px;
    padding: 0 10px;
}

a,
.destyledButton {
    color: #347AB7;
}

p {
    margin-top: 0.5em;
}

svg {
    vertical-align: middle;
}

h1 {
    font-family: "Oswald", "HelveticaNeue-CondensedBold", "Arial Narrow", sans-serif;
    font-weight: bold;
    font-size: 70px;
    text-transform: uppercase;
    text-align: center;
}

hr {
    border: 0 none;
    border-top: 1px solid #aaa;
}

code {
    font-size: 16px;
}



.breadcrumbs {
    height: 1em;
    margin: 1em 0;
}

.uploadArea {
    position: relative;
    margin: 0 auto;
    min-height: 350px;
}
.uploadArea--needsUpload {
    border: 2px dashed #AC9062;
    border-radius: 10px;
    cursor: pointer;
}

.uploadArea--dragging {
    border-style: solid;
    background-color: #E6D4B6;
}

.uploadArea-uploadMessage {
    display: none;
    font-size: 1.9em;
    text-align: center;
    margin-top: 100px;
    pointer-events: none;
}
.uploadArea--needsUpload .uploadArea-uploadMessage {
    display: block;
}

.uploadArea-uploadMessage small {
    font-size: 0.5em;
}


.chart {
    position: relative;
    margin: 0 auto;
    min-height: 350px;
}
.chart--large {
    width: 950px;
    margin-left: -100px;
}



.hiddenFileInput {
    width: 0px;
    height: 0px;
    visibility: hidden;
}

.chart path {
    stroke: #fff;
}

.details {
    position: absolute;
    top: 325px;
    left: 50%;
    width: 170px;
    margin-left: -85px;
    font-size: 14px;
    text-align: center;
    color: #666;
    z-index: -1;
    overflow: hidden;
    text-overflow: ellipsis;
}

.chart--large .details {
    top: 425px;
}

.details-size {
    font-size: 0.9em;
    margin-top: 1em;
}

.details-name {
    font-weight: bold;
}

.details-subText {
    min-height: 1.2em;
}

.details-percentage {
    margin: 0.4em 0 0em;
    font-size: 2.4em;
    line-height: 1em;
}



.errorMessage {
    margin-top: 2em;
    padding: 0.8em 1em;
    border: 1px solid #ab2222;
    color: #ab2222;
}


footer {
    margin-top: 4em;
}

footer h2 {
    margin: 1.5em 0 0.5em;
    font-size: 1.3em;
}



.destyledButton {
    background: none;
    border: 0 none;
    cursor: pointer;
    font-size: inherit;
    padding: 0;
    text-decoration: underline;
}

earTimeout) {\n        //normal enviroments in sane situations\n        return clearTimeout(marker);\n    }\n    // if clearTimeout wasn't available but was latter defined\n    if ((cachedClearTimeout === defaultClearTimeout || !cachedClearTimeout) && clearTimeout) {\n        cachedClearTimeout = clearTimeout;\n        return clearTimeout(marker);\n    }\n    try {\n        // when when somebody has screwed with setTimeout but no I.E. maddness\n        return cachedClearTimeout(marker);\n    } catch (e){\n        try {\n            // When we are in I.E. but the script has been evaled so I.E. doesn't  trust the global object when called normally\n            return cachedClearTimeout.call(null, marker);\n        } catch (e){\n            // same as above but when it's a version of I.E. that must have the global object for 'this', hopfully our context correct otherwise it will throw a global error.\n            // Some versions of I.E. have different rules for clearTimeout vs setTimeout\n            return cachedClearTimeout.call(this, marker);\n        }\n    }\n\n\n\n}\nvar queue = [];\nvar draining = false;\nvar currentQueue;\nvar queueIndex = -1;\n\nfunction cleanUpNextTick() {\n    if (!draining || !currentQueue) {\n        return;\n    }\n    draining = false;\n    if (currentQueue.length) {\n        queue = currentQueue.concat(queue);\n    } else {\n        queueIndex = -1;\n    }\n    if (queue.length) {\n        drainQueue();\n    }\n}\n\nfunction drainQueue() {\n    if (draining) {\n        return;\n    }\n    var timeout = runTimeout(cleanUpNextTick);\n    draining = true;\n\n    var len = queue.length;\n    while(len) {\n        currentQueue = queue;\n        queue = [];\n        while (++queueIndex &lt; len) {\n            if (currentQueue) {\n                currentQueue[queueIndex].run();\n            }\n        }\n        queueIndex = -1;\n        len = queue.length;\n    }\n    currentQueue = null;\n    draining = false;\n    runClearTimeout(timeout);\n}\n\nprocess.nextTick = function (fun) {\n    var args = new Array(arguments.length - 1);\n    if (arguments.length > 1) {\n        for (var i = 1; i &lt; arguments.length; i++) {\n            args[i - 1] = arguments[i];\n        }\n    }\n    queue.push(new Item(fun, args));\n    if (queue.length === 1 && !draining) {\n        runTimeout(drainQueue);\n    }\n};\n\n// v8 likes predictible objects\nfunction Item(fun, array) {\n    this.fun = fun;\n    this.array = array;\n}\nItem.prototype.run = function () {\n    this.fun.apply(null, this.array);\n};\nprocess.title = 'browser';\nprocess.browser = true;\nprocess.env = {};\nprocess.argv = [];\nprocess.version = ''; // empty string to avoid regexp issues\nprocess.versions = {};\n\nfunction noop() {}\n\nprocess.on = noop;\nprocess.addListener = noop;\nprocess.once = noop;\nprocess.off = noop;\nprocess.removeListener = noop;\nprocess.removeAllListeners = noop;\nprocess.emit = noop;\n\nprocess.binding = function (name) {\n    throw new Error('process.binding is not supported');\n};\n\nprocess.cwd = function () { return '/' };\nprocess.chdir = function (dir) {\n    throw new Error('process.chdir is not supported');\n};\nprocess.umask = function() { return 0; };\n"},{"id":2,"identifier":"external \"React\"","name":"external \"React\"","index":118,"index2":116,"size":42,"cacheable":false,"built":false,"optional":false,"prefetched":false,"chunks":[0],"assets":[],"issuer":"/Users/wukeyu/WebstormProjects/react-example/node_modules/babel-loader/lib/index.js!/Users/wukeyu/WebstormProjects/react-example/src/redux/app.js","failed":false,"errors":0,"warnings":0,"reasons":[{"moduleId":17,"moduleIdentifier":"/Users/wukeyu/WebstormProjects/react-example/node_modules/react-router/lib/RouteUtils.js","module":"./~/react-router/lib/RouteUtils.js","moduleName":"./~/react-router/lib/RouteUtils.js","type":"cjs require","userRequest":"react","loc":"12:13-29"},{"moduleId":49,"moduleIdentifier":"/Users/wukeyu/WebstormProjects/react-example/no
